import React from 'react'

const Dome = (props: any) => {
  return (

    <svg xmlns="http://www.w3.org/2000/svg" 
      xmlnsXlink="http://www.w3.org/1999/xlink" 
      version="1.1" 
      role="img" 
      className="style-scope image-mask card__img mask" 
      preserveAspectRatio={props.width === '100%' ? "none": ''}
      viewBox={`0 0 ${parseInt(props.width)} ${parseInt(props.height)}`} 
      width={props.width} 
      height={props.height}>
  
      <defs className="style-scope image-mask">
        <clipPath clipPathUnits="objectBoundingBox" className="style-scope image-mask" id={props.type}>
          {/* <path className="style-scope image-mask" d="M 0.5, 0 C 0.1, 0 0, 0.1 0, 0.5 0, 0.9 0.1, 1 0.5, 1 0.9, 1 1, 0.9 1, 0.5 1, 0.1 0.9, 0 0.5, 0 Z"></path> */}
          {/* <path className="style-scope image-mask" d="M 0 0, 1 0, 1 1, 0 1 z"></path> */}
          <rect x="0" y="50" width="100" height="50" />
        </clipPath>
      </defs>

      <foreignObject clipPath={`url(#${props.type})`}  width="100" height="100">
        <img src={props.img} height="100%" />
      </foreignObject>   

          {/*  <image height="100%" 
              width="100%" 
              preserveAspectRatio="xMidYMid slice" 
              className="mask-name style-scope image-mask" 
              clip-path={`url(#${props.type})`} 
              xlinkHref={props.img}></image>   */}
    
    </svg>
   
  )
}

export default Dome;
